import React from 'react';
const Information = () =>
{
    return(
        <div>
            <h4>Тестовая компонента</h4>
            <p>Одна из тестовых строк компоненты</p>
            <ul>
                <li>Элемент1</li>
                <li>Элемент2</li>
                <li>Элемент3</li>
            </ul>
        </div>
    )
}
export default Information;
